import React, { Component } from "react";
class Head extends Component {
  state = {
    logo: "https://imgur.com/gpvVWGa.jpg",
    myVid: (
      <iframe
        width="1280"
        height="720"
        src="https://www.youtube.com/embed/ojcNcvb1olg"
        frameborder="0"
        allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture"
        allowfullscreen
      ></iframe>
    )
  };
  render() {
    return (
      <div>
        <h1>Hello, World!</h1>
        <img src={this.state.logo} />;{this.myVid}
      </div>
    );
  }
}

export default Head;
